body:
@zealerww There's still work in progress to improve quantized models. The change for the multi-threaded GEMM fixed half of the performance for ConvInteger. There's still a significant cost from the im2col step in the current implementation: for some of the early 3x3 kernel nodes, the im2col time is twice that of the GEMM. 

The float implementation of convolution that you get with ORT_DISABLE_ALL does better by threading the im2col step with the GEMM operation. The implementation also tiles the im2col operation to avoid needing to instantiate the entire buffer in memory. This has not been done for the integer convolution path.

If you enable ORT_ENABLE_ALL, the float convolution goes down a different path that does layout optimizations (the fp32 number above would be closer to 25ms I suspect). The equivalent also needs to be done for quantized convolution to avoid im2col completely.
